import React from 'react'
import { useHistory } from 'react-router-dom'

const MainPage = () => {

    const history = useHistory();
    const onClickHandler = () => {
        history.push("/main")
    }

    return (
        <div>
            MainPage
            <button onClick={onClickHandler}>Boton</button>
        </div>
    )
}

export default MainPage
